The modules hierarchy A Module helps to bundle entry registrations to the registry. It's an implementation of the interface Module. However, a convenient abstracted implementation, AbstractModule, handles already the boilerplate stuff. import { AbstractModule } from "@tmorin/ceb-inversion-core" export class WorldModule extends AbstractModule {
async configure(): Promise<void> { // register a name this.registry.registerValue("name", "World")
}
} export class GreetingModule extends AbstractModule {
async configure(): Promise<void> { // register a factory this.registry.registerFactory( "greeting", (registry) => `Hello, ${registry.resolve("name")}!` )
}
} The modules are used during the creation of a container and must be provided to the ContainerBuilder. import { ContainerBuilder } from "@tmorin/ceb-inversion-core"
import { GreetingModule, WorldModule } from "./ioc-container-module-class" ContainerBuilder.get()
.module(new GreetingModule())
.module(new WorldModule())
.build()
.initialize()
.then((container) => { // resolve the greeting entry const greeting = container.registry.resolve("greeting") // assert the greeting text match the expected one console.assert(greeting === "Hello, World!") // release the stateful stuff return container.dispose()
})
.catch((e) => console.error(e)) Sometime, the class usage can be a bit too much. Therefore, an inline way to available using OnlyConfigureModule.create(...). import {
ContainerBuilder,
OnlyConfigureModule,
} from "@tmorin/ceb-inversion-core" ContainerBuilder.get()
.module( OnlyConfigureModule.create(async function () { // register a name this.registry.registerValue("name", "John Doe") // register a factory this.registry.registerFactory( "greeting", (registry) => `Hello, ${registry.resolve("name")}!` ) })
)
.build()
.initialize()
.then((container) => { // resolve the greeting entry const greeting = container.registry.resolve("greeting") // assert the greeting text match the expected one console.assert(greeting === "Hello, John Doe!") // release the stateful stuff return container.dispose()
})
.catch((e) => console.error(e))

